import{_ as e,c as a,a2 as l,o as r}from"./chunks/framework.ek9jOonm.js";const f=JSON.parse('{"title":"2023 年度总结","description":"","frontmatter":{},"headers":[],"relativePath":"record-2023/2023-summary.md","filePath":"record-2023/2023-summary.md"}'),d={name:"record-2023/2023-summary.md"};function o(s,t,n,i,h,p){return r(),a("div",null,t[0]||(t[0]=[l('<h1 id="_2023-年度总结" tabindex="-1">2023 年度总结 <a class="header-anchor" href="#_2023-年度总结" aria-label="Permalink to &quot;2023 年度总结&quot;">​</a></h1><h2 id="大事件" tabindex="-1">大事件 <a class="header-anchor" href="#大事件" aria-label="Permalink to &quot;大事件&quot;">​</a></h2><table tabindex="0"><thead><tr><th style="text-align:left;"><div style="width:60px;">时间 </div></th><th style="text-align:left;"><div style="width:140px;">关键词</div></th><th style="text-align:left;">描述</th></tr></thead><tbody><tr><td style="text-align:left;">1-2 月</td><td style="text-align:left;">正常上班</td><td style="text-align:left;">正常工作英语培训学习</td></tr><tr><td style="text-align:left;">3-5 月</td><td style="text-align:left;">被裁员，夫妻双双失业</td><td style="text-align:left;">此时夫妻双双失业居家 emo，职业生涯的至暗时刻； 结刚结婚不到半年，夫妻双双失业，没有现金流，安全感瞬间爆炸</td></tr><tr><td style="text-align:left;">5-7 月</td><td style="text-align:left;">雨过天晴，双双入职，职业下行</td><td style="text-align:left;">求职拿了几个 offer，在这个市场低迷的时刻，选择一个技术和团队都还 ok 的公司入职； 此时对象也入职了，但是不如预期；目的也只是苟活，先挣钱；只能说，<strong>结婚领证</strong>这个事情，还是没有考虑周到，对女性求职太不友好了，贪图 3 天婚假，付出的代价太大了！</td></tr><tr><td style="text-align:left;">7-12 月</td><td style="text-align:left;">正常工作</td><td style="text-align:left;">正常工作，融入团队</td></tr></tbody></table><h2 id="成长" tabindex="-1">成长 <a class="header-anchor" href="#成长" aria-label="Permalink to &quot;成长&quot;">​</a></h2><ul><li><strong>Vim 熟悉：</strong> 在 VS Code 使用 <code>vim</code> 插件，结合几个简单的自定义快捷键，开发的时候基本可以专注代码，减少使用鼠标频率；</li><li><strong>双拼 熟悉：</strong> 之前打字都是使用 拼音打字，了解双拼以后，尝试上手熟悉，过了磨合期，还是比较容易的，对于打字速度有一定的提升；毕竟只需要 2 个字母即可打出一个 汉字，效率确实提升不少；</li><li><strong>React Hooks：</strong> 在这个团队中，大牛很多，学习大佬的代码，对 React 开发技术确实提升很多，感谢各位大佬的指导关照；</li></ul><hr><h2 id="记录" tabindex="-1">记录 <a class="header-anchor" href="#记录" aria-label="Permalink to &quot;记录&quot;">​</a></h2><p>01 <strong>断更和碎片知识陷阱</strong></p><hr><p>进入 EPAM 以后，陷入一段迷茫期，所以间隔了近一年没有每日记录；</p><p>2022 和 2023 ，也只有 2023 下半年才有记录；虽然开始恢复记录时信心满满，但是实际还是很难克服自己的惰性，没有坚持每周 3 篇更新；</p><p>写了个简单的 浏览器插件用于管理 书签方便整理每日笔记内容；但是帮助有限；</p><p>再者，若仅仅是内容聚合式的更新，我觉的意义会比较小；会陷入 <strong>碎片知识的陷阱</strong>，所以，往后的内容记录，可能会有所改变；</p><hr><p>02 <strong>图源挂了补救和思考</strong></p><hr><p>每日笔记自动插入图片的源网站挂了，无法恢复，导致我当前的笔记配图来源全部挂了；</p><p>虽然更换了其他源，感觉也无法保证永久稳定；</p><p>最优解，大概是使用自己的图床了；</p><p>暂且先写这么多吧，回头有思绪在继续补充；</p>',20)]))}const c=e(d,[["render",o]]);export{f as __pageData,c as default};
